Generate a random u64 using the by-the-book implementation

Example:

```
let value = xorshift(0xBAD5EEDdeadbeef);
println!("{:?}", value);
```

Generate 4 random u64 by running 4 parallel xorshifts using avx.

Example:

```
 let mut seed: [u64; 4] = [
     0xBAD5EEDdeadbeef,
     0xBAD5EEDdeadbeef,
     0xBAD5EEDdeadbeef,
     0xBAD5EEDdeadbeef,
 ];
let values = xorshift_avx(& mut seed);
println!("{:?}", values);
```
